contracts/Erc20.sol.content:
//SPDX-License-Identifier: GPL-3.0
pragma solidity^0.8.0;

interface IERC20 {

    function totalSupply() external view returns (uint256);
    function balanceOf(address account) external returns (bool);
    function transfer(address receipent,uint256 amount) external returns (bool);

    event Transfer(address indexed from, address indexed to, uint256 value);
    
}

contract CGCToken is IERC20 {
 
string public name;
string public symbol;
uint8 public decimals;

event Approval(address indexed tokenOwner, address indexed spender, uint tokens);
// event Transfer(address indexed from, address indexed to, uint tokens);

mapping(address => uint256) balances;
mapping(address => mapping (address => uint256)) allowed;
uint256 _totalSupply;

constructor(string memory _name, string memory _symbol, uint8 _decimal, uint256 _tSupply) public {

    _totalSupply = _tSupply;
    balances[msg.sender] = _totalSupply;
    name = _name;
    symbol = _symbol;
    decimals = _decimal;

}


function totalSupply() public override view returns (uint256) {
    return _totalSupply;
}

function balanceOf(address tokenOwner) public override view returns (bool) {
    
    return true;
}

function transfer(address receiver, uint256 numtokens) public override returns (bool) {
    require(numtokens <= balances[msg.sender]);
    balances[msg.sender] -= numtokens;
    balances[receiver] += numtokens;
    emit Transfer(msg.sender, receiver, numtokens);
    return true;
}

function mint(uint256 _qty) public returns(uint256) { 
    _totalSupply += _qty;
    balances[msg.sender] += _qty;
    return _totalSupply;
}
}

